AULT","isDisabled":false,"icon":{"iconType":"CHEVRON_LEFT"},"accessibility":{"label":"Previous"},"trackingParams":"CGgQ8FsiEwi-2vCOkbbvAhWSgsQKHXOGBCc="}}}},"subtitle":{"simpleText":"https://www.sdsmt.edu/Academics/Cocurricular-Programs/WiSE/\n\nThe WiSE Center exists to help every woman student at SD Mines succeed by providing opportunities for actively engaging in the world through leadership, professional development, outreach, and activism. We welcome men and women alike who are committed to gender inclusion and helping to champion women in STEM (science, technology, engineering and math) fields.\n\nVision\nThe WiSE staff are committed to a campus culture that provides all students access to a full range of personal and professional choices, fosters agency and self-determination for all, and creates transformative experiences to help open the door of opportunity wide for all women students.\n\nWhat is WiSE?\nThe Women in Science and Engineering (WiSE) program is designed to educate, recruit, retain, and graduate academically motivated women in STEM fields.\n\nComponents\nThere are three components of WiSE, illustrated through monthly activities and yearly events:\n\nNETWORKING -- with peers through monthly WiSE programming and events\nOUTREACH -- Engaging K-12 students during outreach opportunities throughout the year\nPROFESSIONAL DEVELOPMENT -- through workshops, alumni and industry speakers, and our annual WiSE Networking Dinner\nAdditionally, several WiSE activities and events satisfy many Mines Advantage requirements.\n\nProgram Overview\nWiSE provides students, with particular emphasis on women, with support, encouragement, and information intended to help them stay in STEM fields. We offer our STEMinists, as we like to call them, a host of monthly and annual events, including mentoring for all first-year women students, informal mentoring, career exploration and planning, access to professional development opportunities and professional conferences, and outreach opportunities.\n\nWe address challenges faced by women in entering STEM fields, graduating and staying in STEM professions, and advancing to corporate leadership roles.\n\nSD Mines men as STEMinist champions\nMale champions are an integral part of strengthening and creating opportunities for women in STEM fields. Men and women must work together to create a cultural movement of true gender inclusion. We encourage our men students at SD Mines to attend events, visit the center, and be intentional champions for women in STEM."},"trackingParams":"CGUQ3BwYACITCL7a8I6Rtu8CFZKCxAodc4YEJw==","playAllButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Play all"}]},"icon":{"iconType":"PLAY_ALL"},"navigationEndpoint":{"clickTrackingParams":"CGYQ8FsiEwi-2vCOkbbvAhWSgsQKHXOGBCc=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=L3MRBTd5Cj4\u0026list=PLeDC9r0CP815n5Espe2--K8uNk-_t0L3a","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"L3MRBTd5Cj4","playlistId":"PLeDC9r0CP815n5Espe2--K8uNk-_t0L3a"}},"trackingParams":"CGYQ8FsiEwi-2vCOkbbvAhWSgsQKHXOGBCc="}}}}],"trackingParams":"CGQQuy8YAiITCL7a8I6Rtu8CFZKCxAodc4YEJw=="}},{"itemSectionRenderer":{"contents":[{"shelfRenderer":{"title":{"runs":[{"text":"Veterans Resource Center (VRC)","navigationEndpoint":{"clickTrackingParams":"CE0Q3BwYACITCL7a8I6Rtu8CFZKCxAodc4YEJw==","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLeDC9r0CP817HfZAlbZm1zLfKEnGL2FOs","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLeDC9r0CP817HfZAlbZm1zLfKEnGL2FOs"}}}]},"endpoint":{"clickTrackingParams":"CE0Q3BwYACITCL7a8I6Rtu8CFZKCxAodc4YEJw==","commandMetadata":{"webCommandMetadata":{"url":"/playlist?list=PLeDC9r0CP817HfZAlbZm1zLfKEnGL2FOs","webPageType":"WEB_PAGE_TYPE_PLAYLIST","rootVe":5754,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"VLPLeDC9r0CP817HfZA
